import React from "react";
import axios from "axios";
import { useParams, useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";

const EditGame = () => {

    const {id} = useParams()
    const [gameName, setGameName] = useState("")
    const [gameNameError, setGameNameError] = useState('')

    const [rating, setRating] = useState("")

    const [description, setDescription] = useState("")
    const [descriptionError, setDescriptionError] = useState('')

    const [otherNotes, setOtherNotes] = useState("")

    const [firstName, setFName] = useState(cookies.get("firstName"))
    const [lastName, setLName] = useState(cookies.get("lastName"))
    const [fullName, setFullName] = useState(firstName + ' ' + lastName)

    const [uploadedBy, setUploadedBy] = useState(fullName)

    const navigate = useNavigate()

    useEffect(() => {
        axios.get(`http://localhost:8000/game/${id}`)
            .then( res => {
                setGameName(res.data.gameName);
                setRating(res.data.rating)
                setDescription(res.data.description)
                setOtherNotes(res.data.otherNotes)
            })
            .catch( err => console.log(err) );
    }, []);

    const updateGame = (e) => {

        e.preventDefault()

        axios.put(`http://localhost:8000/game/${id}`, {gameName:gameName, rating:rating, description:description, otherNotes:otherNotes})
        .then(res => {
            console.log(res)
            navigate(`/game/${id}`)
        })
        .catch(err => {
            console.log(err)
            setErrors(err.response.data.err.errors)
        })
    }

    return(
        <div>
            <div className="nav">
                <h3>Welcome {firstName}!</h3>
                <span className="align-self-center"><NavLink to={'/home'}>Home</NavLink> | <NavLink to={`/yourgames/${fullName}`}>Your Games</NavLink> | <NavLink to={'/addgame'}>Add New Game</NavLink> | <Link onClick={logoutHandler} >Logout</Link></span>
                <hr className="nav-line mt-3"/>
            </div>
            <div className="form-container">
                <div className="row justify-content-center">
                    <div className="col-6">
                        <form onSubmit={updateGame}>
                            <h3 className="mb-3">Add a New Game</h3>
                            <div className="form-floating mb-3">
                                <input className="form-control" placeholder="gameName" name="gameName" value={gameName} onChange = {handleGameName}/>
                                <label htmlFor="gameName">Game Name</label>
                                {gameNameError ? <p className="red-text">{gameNameError}</p> : null }
                            </div>
                            <div>
                                <select className="form-select" aria-label="Rating" onChange={(e)=>setRating(e.target.value)}>
                                    <option selected>Rating</option>
                                    <option value="1">1</option>
                                    <option value="2">2</option>
                                    <option value="3">3</option>
                                    <option value="4">4</option>
                                    <option value="5">5</option>
                                    <option value="6">6</option>
                                    <option value="7">7</option>
                                    <option value="8">8</option>
                                    <option value="9">9</option>
                                    <option value="10">10</option>
                                </select>
                            </div>
                            <div className="form-floating mb-3">
                                <textarea className="form-control" placeholder="description" name="description" value={description} onChange = {handleDescription}/>
                                <label htmlFor="description">Description</label>
                                {descriptionError ? <p className="red-text">{descriptionError}</p> : null }
                            </div>
                            <div className="form-floating mb-3">
                                <textarea className="form-control" placeholder="otherNotes" name="otherNotes" value={otherNotes} onChange = {(e) => setOtherNotes(e.target.value)}/>
                                <label htmlFor="otherNotes">Other Notes</label>
                            </div>
                            <input type="hidden" name="uploadedBy" value={uploadedBy} />
                            {errors.gameName ? <p className="red-text">{errors.gameName.message}</p> : null}
                            {errors.rating ? <p className="red-text">{errors.rating.message}</p> : null }
                            {errors.description ? <p className="red-text">{errors.description.message}</p> : null }
                            <button className="btn btn-success mt-3" type="button submit">Confirm</button>
                            <Link to={'/home'}><button className="btn btn-danger mt-3">Cancel</button></Link>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default EditGame
